import numpy as np

def target_distribution_gen_all_2D(name, param_range, param_range2):
    """ Generate a set of target distributions by varying one parameter. which_param sets whether distr. param or noise param."""
    p_target_shapeholder = target_distribution_gen(name, param_range[0], param_range2[0]);
    target_distributions = np.ones(param_range.shape + param_range2.shape + p_target_shapeholder.shape) / (p_target_shapeholder.shape[0])
    for i in range(len(param_range)):
        for j in range(len(param_range2)):
            p_target = target_distribution_gen(name, param_range[i], param_range2[j]);
            target_distributions[i,j,:] = p_target
    return target_distributions

